  const reason = interaction.options.getString('reason') || 'No reason provided';

  if (!interaction.member.permissions.has('BanMembers')) {
    return interaction.reply({ content: 'You don\'t have the necessary permissions.', ephemeral: true });
  }

  interaction.guild.members.ban(member, { reason });

  interaction.reply({ content: `${member.username} has been banned!`, ephemeral: false });
});
```
