A classic challenge in TypeScript's type design!

You're looking for a way to convey "discriminated unions" with a twist: **asserting a narrower type when you know the actual runtime behavior exceeds the theoretical type possibilities.

TypeScript provides a few ways to achieve this. Choose the one that best fits your use case:

**1. **Assertion**: `as` cast or a comment (informative, not enforced)**

While not strictly enforced, you can use an `as` cast to indicate your intention:
```typescript
let value: string | number | boolean; // theoretical type
value = 'a'; // in practice, it'll always be a string
const guaranteedString = value as string; // assert the narrower type
```
Keep in mind that this is only informative and won't prevent errors at runtime if your assumption is wrong.

**2. **Literal types with union**: (enforced, but with a limitation)

Use a union type with literal types to specify the narrower type:
```typescript
type GuaranteedString = ("a" | "b" | "c") | "alwaysA"; // "alwaysA" is the only one in practice
let value: GuaranteedString;
value = "alwaysA";
// TypeScript infers `value` as having type `string`
```
Note the limitation: this approach only works when the narrowed type has a common type (in this case, `string`) with the original union.

**3. **User-defined type guards** (recommended): `.scalablytyped` pattern

Create a custom type guard function to narrow the type:
```typescript
type MyType = string | number | boolean;

function isAlwaysString(value: MyType): value is string {
  // your logic to determine it's always a string
  return true; // or a condition that evaluates to true for your specific case
}

let value: MyType;
value = 'a';
if (isAlwaysString(value)) {
  const narrowValue: string = value; // TypeScript infers `narrowValue` as string
  // use narrowValue
}
```
This approach is more expressive and enforceable, as TypeScript will check that the type guard function returns correctly.

**4. **Type inference with a helper type** (another option)

Create a helper type that takes advantage of type inference:
```typescript
type Narrowed<T, Conditional extends boolean> = Conditional extends true ? T : never;
type AlwaysString = Narrowed<MyType | string, true>; // inferred as string

let value: AlwaysString;
value = 'a';
// TypeScript infers `value` as having type `string`
```
While not as common, this approach can be useful in specific scenarios.

Choose the method that best fits your use case, and remember to document your reasoning to ensure maintainability and transparency.

